import React, { Component } from 'react';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import axios from 'axios';
import { URL_DEFAULT } from '../../../urls/urls';

const token = window.localStorage.getItem('token');

class Exportar extends Component {

    constructor(props) {
        super(props);
        this.state = {
            nodes: ''
        }
    }

    componentDidMount(){
        axios.get('https://bio.torre.co/api/people/'+this.props.user+'/network?deep=10')
        .then(function(res){
            this.setState({
                nodes: res.data.nodes
            })
        }

        )
    }
    
    render() {

        return (

            <div id="index-modulos" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        <div className="card-content">
                            <a href = {URL_DEFAULT + '/exportar'}>Exportar</a>
                            <a href='#' onClick={this.send}>  Enviar reporte</a>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

export default Exportar;
